import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import About from './About.js'

function App() {
  return (
    <div>
      <nav>
        <ui>
          <li>
            <Link to="/about">About</Link>
            <Link to="/">Home</Link>
          </li>
        </ui>
      </nav>

      <Switch>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
